    return(
        <div className="blog-section">
            <div className="bg-light round container">

            </div>
            <h2>Saludos!! Bienvenido al blog,</h2>
            <p>Disfruto mucho aprendiendo sobre las cosas que me apasionan 
            todos los dias y en este espacio compartire articulos sobre tecnologia, videojuegos, diseno y mas!</p>
            <p>Si te interesa la programacion estas en buen lugar! espero que el contenido te sea de ayuda</p>
            <h2>Ultimos posts</h2>
        </div>

    )
}
export default BlogSection;
